import React from "react";
import RecipesCard from "./cardlist/RecipesCard";
import Banner from "./Banner";
import Time from "./Time";
import Level from "./Level";
import styled from "styled-components";
import PropTypes from "prop-types";

function Home({className}) {
  return (
    <div className={className}>
      <Banner />

      <div class="creator">
        <div class="cards">
          <div class="owner">
            <div class="ownerimg">
              <img src="../images/owner/KwanJai.jpg" alt="img" />
            </div>
            <div class="ownerdetails">
              <h3>Kittipat Saiud</h3>
              <p>652110270</p>
            </div>
          </div>
          <div class="owner">
            <div class="ownerimg">
              <img src="../images/owner/Lugie.jpg" alt="img" />
            </div>
            <div class="ownerdetails">
              <h3>Luca Gomis</h3>
              <p>652110300</p>
            </div>
          </div>
          <div class="owner">
            <div class="ownerimg">
              <img src="../images/owner/KwaKwa.jpg" alt="img" />
            </div>
            <div class="ownerdetails">
              <h3>Prapanit Pajeekum</h3>
              <p>652110292</p>
            </div>
          </div>
        </div>
      </div>

      <div class="recipes_lists">
        <div class="optionsbar">
          <button type="submit">Spicy</button>
          <button type="submit">Non-spicy</button>
          <button type="submit">Vegetarian</button>
          <button type="submit">Vegan</button>
        </div>

        <div class="recipes_box">
          <div class="sidebar">
            <div class="type">
              <h2>Dish Type</h2>
              <a href="/">Breakfast</a>
              <a href="/">Lunch</a>
              <a href="/">Dinner</a>
              <a href="/">Appetizer</a>
              <a href="/">Salad</a>
              <a href="/">Main-course</a>
              <a href="/">Baked-goods</a>
              <a href="/">Dessert</a>
              <a href="/">Soup</a>
            </div>

            {/* Time Component */}
            <Time />

            <Level />
          </div>

          {/* RecipesCard Component */}
          <RecipesCard />
        </div>
      </div>

      <div class="end_banner">
        <h2>
          "You've been trying to find a recipe, but you can't seem to find it in
          Recipe Box? Tell us!"
        </h2>
        <button type="submit">Request recipe</button>
      </div>
      </div>
  );
}

Home.propTypes = {
  className: PropTypes.string.isRequired,
};

export default styled(Home)`
.creator {
  border-bottom: 1px solid #e23c34;
}

.creator .cards {
  background-image: linear-gradient(
      to right,
      #f4efdc 0%,
      transparent 20%,
      transparent 90%,
      #f4efdc 100%
    ),
    linear-gradient(
      to left,
      #f4efdc 0%,
      transparent 20%,
      transparent 90%,
      #f4efdc 100%
    ),
    url(../images/recipe/background.png);
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 500px;
}

.creator .owner {
  background-color: rgb(255, 255, 255);
  display: flex;
  justify-content: center;
  flex-direction: column;
  text-align: center;
  margin: 20px;
  padding: 5px;
  width: 250px;
  height: 350px;
}
.owner .ownerimg {
  width: 100%;
  height: 70%;
  border-radius: 100%;
  display: flex;
  align-items: center;
  overflow: hidden;
}
.ownerimg img {
  min-width: 100%;
  min-height: 100%;
  width: auto;
  height: auto;
  object-fit: cover;
}
.owner .ownerdetails {
  color: #e23c34;
  margin: 5px;
  display: flex;
  flex-direction: column;
  align-items: center;
}

.owner .ownerdetails p {
  padding: 5px;
  margin-top: 5px;
  background-color: #fdee82;
  border-radius: 30px;
  width: 60%;
}
`;
